043d\u0430\u044f \u0432\u0435\u0442\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%BC%D1%8C-%D0%9A%D0%BE%D1%82%D0%BB%D0%B0%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0\" title=\"\u041f\u0435\u0440\u043c\u044c-\u041a\u043e\u0442\u043b\u0430\u0441\u0441\u043a\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430\">\u041f\u0435\u0440\u043c\u044c-\u041a\u043e\u0442\u043b\u0430\u0441<\/a>, \u0441\u0442\u0440\u043e\u0438\u0432\u0448\u0430\u044f\u0441\u044f \u043f\u043e \u0443\u043a\u0430\u0437\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f II<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/13_%D0%BC%D0%B0%D1%8F\" title=\"13 \u043c\u0430\u044f\">13 \u043c\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1895_%D0%B3%D0%BE%D0%B4\" title=\"1895 \u0433\u043e\u0434\">1895&#160;\u0433\u043e\u0434\u0430<\/a> \u043d\u0430 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0441\u0447\u0435\u0442. \u0412\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u043e\u043d\u0430 \u0441\u0442\u0430\u043b\u0430 \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0\" title=\"\u041f\u0435\u0440\u043c\u0441\u043a\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430\">\u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u044b\u0445 \u043c\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u043b\u0435\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a> \u0438 \u0441\u0442\u0430\u043b\u0430 \u0441\u043e\u0435\u0434\u0438\u043d\u044f\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%B1%D0%B8%D1%80%D1%8C\" title=\"\u0421\u0438\u0431\u0438\u0440\u044c\">\u0421\u0438\u0431\u0438\u0440\u044c<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%80%D0%B0%D0%BB\" title=\"\u0423\u0440\u0430\u043b\">\u0423\u0440\u0430\u043b<\/a> \u0441 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0420\u043e\u0441\u0441\u0438\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900_%D0%B3%D0%BE%D0%B4\" title=\"1900 \u0433\u043e\u0434\">1900<\/a>&#160;\u2014 \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u0417\u0430\u043a\u043e\u043d\u043e\u043c \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE%D0%B9_%D1%81%D1%82%D0%B0%D0%BD%D0%B4%D0%B0%D1%80%D1%82\" title=\"\u0417\u043e\u043b\u043e\u0442\u043e\u0439 \u0441\u0442\u0430\u043d\u0434\u0430\u0440\u0442\">\u0437\u043e\u043b\u043e\u0442\u043e\u043c \u0441\u0442\u0430\u043d\u0434\u0430\u0440\u0442\u0435<\/a> \u0432 \u0421\u0428\u0410 \u0431\u0443\u043c\u0430\u0436\u043d\u044b\u0435 \u0438 \u043c\u0435\u0442\u0430\u043b\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0434\u0435\u043d\u044c\u0433\u0438 \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0432\u0430\u044e\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE\" title=\"\u0417\u043e\u043b\u043e\u0442\u043e\">\u0437\u043e\u043b\u043e\u0442\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B2%D0%B5%D1%82_%D1%80%D0%B0%D0%B1%D0%BE%D1%87%D0%B8%D1%85_%D0%B8_%D1%81%D0%BE%D0%BB%D0%B4%D0%B0%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%B4%D0%B5%D0%BF%D1%83%D1%82%D0%B0%D1%82%D0%BE%D0%B2\" title=\"\u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0441\u043a\u0438\u0439 \u0441\u043e\u0432\u0435\u0442 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0438 \u0441\u043e\u043b\u0434\u0430\u0442\u0441\u043a\u0438\u0445 \u0434\u0435\u043f\u0443\u0442\u0430\u0442\u043e\u0432\">\u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0441\u043a\u0438\u0439 \u0441\u043e\u0432\u0435\u0442 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0438 \u0441\u043e\u043b\u0434\u0430\u0442\u0441\u043a\u0438\u0445 \u0434\u0435\u043f\u0443\u0442\u0430\u0442\u043e\u0432<\/a> \u0438\u0437\u0434\u0430\u043b \u043f\u0440\u0438\u043a\u0430\u0437 \u2116&#160;1 \u043f\u043e \u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u043c\u0443 \u0433\u0430\u0440\u043d\u0438\u0437\u043e\u043d\u0443 \u043e\u0431 \u0443\u0437\u0430\u043a\u043e\u043d\u0435\u043d\u0438\u0438 \u0441\u043e\u043b\u0434\u0430\u0442\u0441\u043a\u0438\u0445 \u043a\u043e\u043c\u0438\u0442\u0435\u0442\u043e\u0432, \u0432 \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0436\u0435\u043d\u0438\u0435 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043f\u0435\u0440\u0435\u0434\u0430\u0432\u0430\u043b\u043e\u0441\u044c \u0432\u0441\u0451 \u043e\u0440\u0443\u0436\u0438\u0435. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%84%D0%B8%D1%86%D0%B5%D1%80\" title=\"\u041e\u0444\u0438\u0446\u0435\u0440\">\u041e\u0444\u0438\u0446\u0435\u0440\u044b<\/a> \u0431\u044b\u043b\u0438 \u043b\u0438\u0448\u0435\u043d\u044b \u0434\u0438\u0441\u0446\u0438\u043f\u043b\u0438\u043d\u0430\u0440\u043d\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u0438 \u043d\u0430\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BB%D0%B4%D0%B0%D1%82\" title=\"\u0421\u043e\u043b\u0434\u0430\u0442\">\u0441\u043e\u043b\u0434\u0430\u0442\u0430\u043c\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%83%D1%85%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%B0%D1%88%D0%BD%D1%8F\" title=\"\u0428\u0443\u0445\u043e\u0432\u0441\u043a\u0430\u044f \u0431\u0430\u0448\u043d\u044f\">\u0428\u0443\u0445\u043e\u0432\u0441\u043a\u043e\u0439 \u0431\u0430\u0448\u043d\u0438<\/a> \u043d\u0430 \u0428\u0430\u0431\u043e\u043b\u043e\u0432\u043a\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923_%D0%B3%D0%BE%D0%B4\" title=\"1923 \u0433\u043e\u0434\">1923<\/a>&#160;\u2014 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D0%BE%D0%B1%D1%89%D0%B5%D1%81%D1%82%D0%B2%D0%BE_%D0%B4%D0%BE%D0%B1%D1%80%D0%BE%D0%B2%D0%BE%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D0%BE%D0%B3%D0%BE_%D1%84%D0%BB%D0%BE%D1%82%D0%B0\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e \u0434\u043e\u0431\u0440\u043e\u0432\u043e\u043b\u044c\u043d\u043e\u0433\u043e \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e \u0434\u043e\u0431\u0440\u043e\u0432\u043e\u043b\u044c\u043d\u043e\u0433\u043e \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430 \u00ab\u0414\u043e\u0431\u0440\u043e\u043b\u0451\u0442\u00bb<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0432 \u0441\u0432\u044f\u0437\u0438 \u0441 45-\u0439 \u0433\u043e\u0434\u043e\u0432\u0449\u0438\u043d\u043e\u0439 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\">\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 II<\/a> \u0434\u0435\u0432\u044f\u0442\u0438 \u0431\u044b\u0432\u0448\u0438\u043c \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0430\u043c \u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u044f \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0430 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u044c\u043d\u0430\u044f \u043f\u0435\u043d\u0441\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 \u043d\u0430 \u0432\u043e\u0434\u0443 \u0441\u043f\u0443\u0441\u043a\u0430\u0435\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D1%80%D0%BF%D0%B5%D0%B4%D0%BD%D1%8B%D0%B9_%D0%BA%D0%B0%D1%82%D0%B5%D1%80\" title=\"\u0422\u043e\u0440\u043f\u0435\u0434\u043d\u044b\u0439 \u043a\u0430\u0442\u04