\u041b\u043e\u0443\u044d\u043b\u043b\u0430<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u043b\u0430\u043d\u0435\u0442\u0430 \u0431\u044b\u043b\u0430 \u043e\u0442\u043a\u0440\u044b\u0442\u0430, \u044d\u0442\u043e \u0438\u043c\u044f \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u043e \u0432\u0441\u0435 \u0433\u043e\u043b\u043e\u0441\u0430, \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1_%D0%BC%D0%B0%D1%8F\" title=\"1 \u043c\u0430\u044f\">1 \u043c\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930 \u0433\u043e\u0434\u0430<\/a> \u0438\u043c\u044f \u043f\u043b\u0430\u043d\u0435\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BB%D1%83%D1%82%D0%BE%D0%BD_(%D0%BA%D0%B0%D1%80%D0%BB%D0%B8%D0%BA%D0%BE%D0%B2%D0%B0%D1%8F_%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u041f\u043b\u0443\u0442\u043e\u043d (\u043a\u0430\u0440\u043b\u0438\u043a\u043e\u0432\u0430\u044f \u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u041f\u043b\u0443\u0442\u043e\u043d<\/a> \u0431\u044b\u043b\u043e \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D0%B8%D0%B9_%D1%80%D0%B5%D0%B9%D1%85\" title=\"\u0422\u0440\u0435\u0442\u0438\u0439 \u0440\u0435\u0439\u0445\">\u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430<\/a> \u043d\u0430\u0447\u0430\u043b\u0438 \u043e\u043a\u043a\u0443\u043f\u0430\u0446\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u044f\">\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u0438<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0421\u043b\u043e\u0432\u0430\u043a\u0438\u044f\">\u0421\u043b\u043e\u0432\u0430\u043a\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B4%D0%BA%D0%B0%D1%80%D0%BF%D0%B0%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D1%83%D1%81%D1%8C\" title=\"\u041f\u043e\u0434\u043a\u0430\u0440\u043f\u0430\u0442\u0441\u043a\u0430\u044f \u0420\u0443\u0441\u044c\">\u041f\u043e\u0434\u043a\u0430\u0440\u043f\u0430\u0442\u0441\u043a\u0430\u044f \u0420\u0443\u0441\u044c<\/a> \u0444\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0438 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D0%B0%D0%B2%D0%B8%D1%8F\" title=\"\u041c\u043e\u0440\u0430\u0432\u0438\u044f\">\u043c\u043e\u0440\u0430\u0432\u0441\u043a\u043e\u043c<\/a> \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B8%D0%B4%D0%B5%D0%BA-%D0%9C%D0%B8%D1%81%D1%82%D0%B5%D0%BA\" title=\"\u0424\u0440\u0438\u0434\u0435\u043a-\u041c\u0438\u0441\u0442\u0435\u043a\">\u041c\u0438\u0441\u0442\u0435\u043a<\/a> \u0432 \u0431\u043e\u0439 \u0441 \u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D0%BA\" title=\"\u041f\u043e\u043b\u043a\">\u043f\u043e\u043b\u043a\u043e\u043c<\/a> \u0432\u0441\u0442\u0443\u043f\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%82%D0%B0\" title=\"\u0420\u043e\u0442\u0430\">\u0440\u043e\u0442\u0430<\/a> \u0441\u043e\u043b\u0434\u0430\u0442 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%B2%D0%BB%D0%B8%D0%BA,_%D0%9A%D0%B0%D1%80